import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import "../../styles/Pay.css";

// Sample text and image reviews
const textReviews = [
  "RGM Family has changed my career! – John D.",
  "Supportive team and great pay structure! – Sarah W.",
  "I feel valued and appreciated here. – Mike P.",
  "Excellent training and guidance. – Emily R."
];

const imageReviews = [
  "/images/review1.png",
  "/images/review2.png"
];

function Pay() {
  const [currentText, setCurrentText] = useState(0);
  const [currentImage, setCurrentImage] = useState(0);

  // Slideshow for text reviews
  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentText((prev) => (prev + 1) % textReviews.length);
    }, 5000);
    return () => clearInterval(timer);
  }, [textReviews.length]);

  // Slideshow for image reviews
  useEffect(() => {
    const timer = setInterval(() => {
      setCurrentImage((prev) => (prev + 1) % imageReviews.length);
    }, 6000);
    return () => clearInterval(timer);
  }, [imageReviews.length]);

  return (
    <div className="pay-container">
      {/* HERO SECTION */}
      <div className="pay-hero">
        <h1>Driver Pay at RGM Family</h1>
        <p>Maximize your earning potential with performance-based pay</p>
      </div>

      {/* CONTENT */}
      <div className="pay-content">
        <h2>Maximize Your Earning Potential</h2>
        <p>
          At RGM Family, we reward drivers for performance, not just miles.
          Our pay structure ensures your hard work reflects directly in
          your paycheck. Focus on driving — we’ll take care of the rest.
        </p>

        <h2>Additional Pay Opportunities</h2>
        <ul>
          <li>Tarp Pay</li>
          <li>Breakdown Pay</li>
          <li>Referral Bonuses</li>
          <li>Stop Pay</li>
          <li>Detention Pay</li>
          <li>Over-Dimensional Load Pay</li>
          <li>Vacation Pay</li>
          <li>Sign-On Bonuses</li>
        </ul>

        {/* Stats Section */}
        <h2>Driver Satisfaction</h2>
        <div className="progress-bar">
          <div className="progress-fill" style={{ width: `100%` }}>
            100%
          </div>
        </div>
      </div>

      {/* CTA BOX */}
      <div className="cta-box">
        <h2>Drive It Like You Own It.</h2>
        <Link to="/join/apply" className="apply-btn">
          Apply Now
        </Link>
      </div>

      {/* Reviews Section */}
      <div className="reviews-section">
        <h2>What Our Drivers Say</h2>

        {/* Text Reviews */}
        <div className="text-review">
          <p>"{textReviews[currentText]}"</p>
        </div>

        {/* Image Reviews */}
        <div className="image-review">
          <img src={imageReviews[currentImage]} alt="Driver Review" />
        </div>

        <p className="review-source">
          Reviews source:{" "}
          <a
            href="https://www.carriersource.io/carriers/rgm-line-haul-inc#reviews"
            target="_blank"
            rel="noopener noreferrer"
          >
            CarrierSource
          </a>
        </p>
      </div>
    </div>
  );
}

export default Pay;
